Say we have a command /msg <target> <message> LinkedHashMap<String, Argument> arguments = new LinkedHashMap<>();
arguments.put("target", new PlayerArgument());
arguments.put("message", new GreedyStringArgument()); CommandAPI.getInstance().register("msg", arguments, (sender, args) -> { ((Player) args[0]).sendMessage((String) args[1]);
}); Any text entered after the <target> argument would be sent to the player. For example, the command could be used as follows: /msg Skepter This is some incredibly long string with "symbols" and $p3c!aL characters~ Due to the fact that the GreedyStringArgument has no terminator (it has infinite length), a GreedyStringArgument must be defined at the end of the LinkedHashMap (otherwise the CommandAPI will throw a GreedyStringException ) For example, if the syntax was /msg <message> <target> , it would not be able to determine where the message ends and the <target> argument begins.

