}); Developer's Note: As you can see, there are multiple ways of applying permissions to commands with arguments. In the /god command shown above, the permission was applied to the whole command. In the /kill command shown above, the permission was applied to the argument. There's not really much difference between the two methods, but I personally would use argument permissions with .withPermission() as it has greater control over arguments.
